import {Card} from 'antd';
const Info = () => {
	return (
	<div className="info">
		<div className="title">
			뇌솔드 (뇌제 솔로 레이드)
		</div>
		<Card title="1. 공속 순서" extra={<a href="#">More</a>} style={{ width: 300 }}>

		</Card>

	</div>
	)
};

export default Info
